svg.script:
//
//TODO: Minify JS code
//TODO: Remove console.log() output
var iconicApis = window._Iconic ? window._Iconic.smartIconApis : {};
iconicApis["grid-lines"] = iconicApis["grid-lines"] || function(t) {

    window.logging = true;

    $c().log("Staring grid-direction ...");

    var f1 = function(gridDirection) {

        var direction = gridDirection.toLowerCase();

        $c().log("Direction: " + direction);

        t.setAttribute("data-grid-direction", direction);

        $c().log("direction: " + direction);    

        /*
         1. Hide all elements (more efficient than listing every element)
         2. Show only required elements for specified properties
         3. Top and right axes are hidden by default. Only shown on 'both'
        */

        $c(t).off([
            ".iconic-grid-lines",
            ".iconic-grid-lines-axis-top", 
            ".iconic-grid-lines-axis-right"
        ]);

        if ("horizontal" === direction) {

            $c().log("Setting grid lines direction to horizontal");

            $c(t).on([
                ".iconic-grid-lines-horizontal",
                ".iconic-grid-lines-tick-mark-bottom-last",
                ".iconic-grid-lines-tick-mark-left-first"
            ]);
        } 
        else if ("vertical" === direction) {

            $c().log("Setting grid lines direction to horizontal");

            $c(t).on([
                ".iconic-grid-lines-vertical",
                ".iconic-grid-lines-tick-mark-bottom-last",
                ".iconic-grid-lines-tick-mark-left-first",
                ".iconic-grid-lines-vertical-last"
            ]);
        }
        else if ("both" === direction) {

            $c().log("Setting grid lines direction to both");

            $c(t).on([
                ".iconic-grid-lines-axis-top",
                ".iconic-grid-lines-axis-right",
                ".iconic-grid-lines"
            ]);
        }
        else {

            $c().log("Setting grid lines direction to none");

            $c(t).on([
                ".iconic-grid-lines-tick-mark-bottom-last",
                ".iconic-grid-lines-tick-mark-left-first"
            ]);
        }
    };
    var f2 = function() {
        var e = t.getAttribute("data-grid-direction");
        e && f1(e)
    };
    return {
        update: f2,
        setGridDirection: f1
    }
};
//
